  constructor() {
    super()
    this.state = {
      errors: {},
      msg: {},
      loading: true,
      fields: []
    }
  }

  handleChange = event => {
    this.setState({
      [event.target.name]: event.target.value
    })
  }

  handleReset = () => {
    this.setState({
      nome: '',
      matricula: '',
      sexo: '',
      cpf: '',
      nascimento: '',
      email: '',
      telefone: '',
      pais: ''
    })
  }

  handleSubmit = event => {
    event.preventDefault()
    this.setState({
      loading: true
    })
    const config = {
      headers: {
        Authorization: localStorage.FBidToken
      }
    }
    const userData = {
      nome: this.state.nome,
      matricula: this.state.matricula,
      sexo: this.state.sexo,
      cpf: this.state.cpf.replace(/\./g, '').replace('-', ''),
      nascimento: this.state.nascimento,
      email: this.state.email,
      telefone: this.state.telefone,
      pais: this.state.pais
    }
    axios
      .post('/editarAluno', userData, config)
      .then(res => {
        this.setState({
          msg: res.data,
          loading: false
        })
      })
      .catch(err => {
        console.log(err)
        this.setState({
          errors: err.response.data,
          loading: false
        })
      })
  }

  handleChange = event => {
    this.setState({
      [event.target.name]: event.target.value
    })
  }

  handleReset = () => {
    this.setState({
      nome: '',
      matricula: '',
      sexo: '',
      cpf: '',
      nascimento: '',
      email: '',
      telefone: '',
      pais: ''
    })
  }

  render() {
    const { classes } = this.props
    const { msg, loading } = this.state
    return (
      <Fade in={true} timeout={{ enter: 250 }}>
        <div>
          <Typography variant="h3" className={classes.title}>
            Dados de Desempenho
          </Typography>
          <Typography variant="h5" className={classes.title}>
            {history.location.state.nome}
          </Typography>
          <form noValidate onSubmit={this.handleSubmit}>
            <Grid container spacing={3}>
              {loading && <Loader />}
              {!loading && fields}
              <Grid item xs={12}>
                {msg.message && (
                  <Typography variant="body2" className={classes.success}>
                    {msg.message}
                  </Typography>
                )}
                <ButtonGroup
                  fullWidth
                  aria-label="Full width contained button group"
                  variant="contained"
                  color="primary"
                >
                  <Button
                    disabled={loading}
                    type="submit"
                    color="dark"
                    className={classes.button}
                  >
                    Salvar
                  </Button>
                  <Button type="reset" onClick={this.handleReset} color="dark">
                    Limpar
                  </Button>
                  <Button onClick={() => history.goBack()} color="dark">
                    Voltar
                  </Button>
                </ButtonGroup>
              </Grid>
            </Grid>
          </form>
        </div>
      </Fade>
    )
  }
}

